import time
from math import comb
from typing import List
from collections import defaultdict, Counter


class Solution:
    def numberOfGoodPaths(self, vals: List[int], edges: List[List[int]]) -> int:
        def find(x):
            if parent[x] != x:
                parent[x] = find(parent[x])
            return parent[x]

        def union(a, b):
            parent[find(b)] = find(a)

        value_map = defaultdict(list)
        for i, val in enumerate(vals):
            value_map[val].append(i)

        edge_map = defaultdict(list)
        for i, j in edges:
            if vals[i] >= vals[j]:
                edge_map[i].append(j)
            if vals[j] >= vals[i]:
                edge_map[j].append(i)

        res = len(vals)
        parent = {i: i for i in range(res)}
        for v in sorted(set(vals)):
            for node in value_map[v]:
                for adj in edge_map[node]:
                    union(node, adj)

            counts = Counter(find(node) for node in value_map[v])
            res += sum(comb(count, 2) for count in counts.values())

        return res

    def numberOfGoodPaths2(self, vals: List[int], edges: List[List[int]]) -> int:
        def find(x):
            while parent[x] != x:
                # x, parent[x] = parent[x], parent[parent[x]] # this is bad, very very slow
                parent[x], x = parent[parent[x]], parent[x]
            return x

        def union(a, b):
            parent[find(b)] = find(a)

        value_map = defaultdict(list)
        for i, val in enumerate(vals):
            value_map[val].append(i)

        edge_map = defaultdict(list)
        for i, j in edges:
            if vals[i] >= vals[j]:
                edge_map[i].append(j)
            if vals[j] >= vals[i]:
                edge_map[j].append(i)

        res = len(vals)
        parent = {i: i for i in range(res)}
        for v in sorted(list(set(vals))):
            for node in value_map[v]:
                for adj in edge_map[node]:
                    union(node, adj)

            counts = Counter(find(node) for node in value_map[v])
            res += sum(comb(count, 2) for count in counts.values())

        return res


